import React, { Component } from 'react';
import {FirebaseDatabaseMutation}
                         from "@react-firebase/database";
import './set-sensetive.css';


export default class SetSensetive extends Component {

  state = {
    person: null,
    setSensetive : 1,
    setFront : 1
  };

  setSens = (event)=>{
    let sensValue=parseInt(event.target.value, 10);
    console.log("event"+sensValue);
    this.setState({setSensetive:sensValue});
  }

  setFrontF=(event)=>{
    const frontValue=parseInt(event.target.value,10);
    this.setState({setFront: frontValue});
      console.log(this.state.setFront);
      console.log(frontValue);
 }

  render() {
    const path = this.props.path;
    return (
      <div>

          <FirebaseDatabaseMutation type="set" path={path}>
             {({ runMutation }) => {
                return (
                  <div>
                  <input type = "number" size="4" className="butnSens" onChange ={this.setSens} /><h4>sens</h4><br/>
                  <input type = "number" size="4" className="butnSens" onChange ={this.setFrontF}/><br/>
                  <input type = "number" size="4" className="butnSens" onChange ={this.setFrontF}/><br/>

                  <button
                      data-testid="test-push"
                      onClick={async () => {
                        if(this.state.setSensetive>0&&this.state.setSensetive<1000&&this.state.setFront>0&&this.state.setFront<1000){
                            const { key } = await runMutation({ PARAM: this.state.setSensetive , Front: this.state.setFront});
                        } else alert("Namber must be integer and less 1000");
                        //this.setState({ pushedKey: key });
                        //console.log("key"+key);
                      }}
                    > {this.props.btnText}
                    </button><br/>


                  </div>
                );
              }}
          </FirebaseDatabaseMutation>
      </div>
    )
  }
}
